__NUXT_JSONP__("/drugs/Cytokine-based_Biologic_Agent_IRX-2", (function(a,b,c,d){return {data:[{drug:{slug:b,emaEpar:[],fdaDrugLabel:[],id:b,nciThesaurus:{casRegistry:a,chebiId:a,chemicalFormula:a,definition:"A cell-free mixture comprised of a variety of naturally-derived cytokines obtained from normal, unrelated donor lymphocytes with potential immunostimulatory activity. The cytokines in IRX-2, including interleukin (IL)-1, -2, -6, -8, -10, -12, tumor necrosis factor alpha (TNF-a), interferon-gamma (IFN-g) and colony stimulating factors (CSFs), play vital roles in regulating cellular immunity and may synergistically stimulate a cellular immune response against tumor cells.",fdaUniiCode:"ZDR4QSJ43F",identifier:"C53396",preferredName:c,semanticType:"Amino Acid, Peptide, or Protein",subclassOf:["C1283"],synonyms:[c,"IRX-2"]},dir:"\u002Fdrugs",path:"\u002Fdrugs\u002FCytokine-based_Biologic_Agent_IRX-2",extension:".json",createdAt:d,updatedAt:d}}],fetch:{},mutations:void 0}}("","Cytokine-based_Biologic_Agent_IRX-2","Cytokine-based Biologic Agent IRX-2","2021-10-30T13:40:37.513Z")));